# Model

alpha_hyperparam = 0.5
beta_hyperparam = 0.5

taus = torch.linspace(0, 10, 100)


class SparseLogisticRegression(object):
    def __init__(self, X_train, X_check, Y_check):
        super().__init__()
        self.X_train = X_train
        self.X_check = X_check
        self.Y_check = Y_check

    @bm.random_variable
    def tau(self):
        return dist.Gamma(alpha_hyperparam, beta_hyperparam)

    @bm.random_variable
    def lambda_(self):
        return dist.Gamma(alpha_hyperparam, beta_hyperparam).expand(
            [self.X_train.shape[1], 1]
        )

    @bm.random_variable
    def beta(self):
        return dist.Normal(0, 1).expand([self.X_train.shape[1], 1])

    @bm.random_variable
    def y(self):
        return dist.Bernoulli(
            logits=self.X_train @ (self.tau() * self.beta() * self.lambda_())
        )

    @bm.functional
    def log_prob_check(self):
        return (
            dist.Bernoulli(
                logits=self.X_check @ (self.tau() * self.beta() * self.lambda_())
            )
            .log_prob(self.Y_check)
            .sum()
        )

    def __repr__(self):
        return f"SparseLogisticRegression with {self.X_train.shape[1]} covariates"


# Creating sample data

X = dist.Normal(0, 5).expand([1000, 2]).sample()

true_tau = dist.Gamma(alpha_hyperparam, beta_hyperparam).sample()
true_lambda = (
    dist.Gamma(alpha_hyperparam, beta_hyperparam).expand([X.shape[1], 1]).sample()
)
true_beta = dist.Normal(0, 1).expand([X.shape[1], 1]).sample()

Y = dist.Bernoulli(logits=X @ (true_tau * true_beta * true_lambda)).sample()

X_train, X_check, Y_train, Y_check = sklearn.model_selection.train_test_split(X, Y)

