class tutorialSparseLogisticRegressionTest(unittest.TestCase):
    def test_tutorial_Sparse_Logistic_Regression(self) -> None:
        """Check BM and BMG inference both terminate"""

        self.maxDiff = None

        # Inference with BM

        # Note: No explicit seed here (in original tutorial model). Should we add one?
        nmc = bm.SingleSiteNewtonianMonteCarlo()
        samples_nmc = nmc.infer(
            queries=queries,
            observations=observations,
            num_samples=num_samples,
            num_chains=num_chains,
        )

        mh = bm.SingleSiteAncestralMetropolisHastings()
        samples_mh = mh.infer(
            queries=queries,
            observations=observations,
            num_samples=num_samples,
            num_chains=num_chains,
        )

        mhc = bm.SingleSiteHamiltonianMonteCarlo(path_length=1, step_size=0.05)
        samples_mhc = mhc.infer(
            queries=queries,
            observations=observations,
            num_samples=num_samples,
            num_chains=num_chains,
        )

        self.assertTrue(True, msg="We just want to check this point is reached")

    def disabled_test_tutorial_Sparse_Logistic_Regression_to_dot_cpp_python(
        self,
    ) -> None:
        self.maxDiff = None
        observed = BMGInference().to_dot(queries, observations)
        expected = """
        """
        self.assertEqual(expected.strip(), observed.strip())

        observed = BMGInference().to_cpp(queries, observations)
        expected = """
"""
        self.assertEqual(expected.strip(), observed.strip())

        observed = BMGInference().to_python(queries, observations)
        expected = """
"""
        self.assertEqual(expected.strip(), observed.strip())
